		return ret
	end*/
	local function apsa_HitboxCollide(box1,box2,x1,y1,x2,y2)
		local xdist=abs((x1) - (x2))
		local ydist=abs((y1) - (y2))
		local ret=false
		if (xdist < box1.w+box2.w and ydist < box1.h+box2.h)
			ret=true
		end
		return ret
	end

